('basic', 0, 2, 2, 'en', 0, '<div class=\"IKCS-subscribe\">\r\n<p class=\"IKCS-subscribe-p\">Newsletter Subscription</p>\r\n<a class=\"IKCS-subscribe-a\" href=\"\" data-toggle=\"modal\" data-target=\"#mailchimpModal\">SUBSCRIBE</a></div>\r\n', '', 'full_html'),
('basic', 0, 3, 3, 'en', 0, '<div class=\"IKCS-footer-social\"><a class=\"IKCS-footer-social-a\" href=\"https://www.facebook.com/industrialkitchencleaningsolutions/?ref=page_internal\" target=\"_blank\"><img alt=\"IKCS Facebook\" data-entity-type=\"file\" data-entity-uuid=\"26fde119-7d0b-4de2-ba63-3cab51e98ffa\" src=\"/sites/default/files/inline-images/ikcs-fb.png\" /> </a> <a class=\"IKCS-footer-social-a\" href=\"https://www.instagram.com/industrial_kitchen_solutions/\" target=\"_blank\"> <img alt=\"IKCS Instagram\" data-entity-type=\"file\" data-entity-uuid=\"cf041f97-e95c-4d79-b9ec-5b7cd320cf23\" src=\"/sites/default/files/inline-images/ikcs-insta.png\" /> </a></div>\r\n<div class=\"backlink\">Web design by <a class=\"backlink-a\" href=\"http://www.calypsocreative.co.za/\">Calypso Creative</a></div>\r\n', '', 'full_html'),
