('basic', 0, 7, 10, 'en', 0, '<p><img alt=\"contact\" data-align=\"right\" data-entity-type=\"file\" data-entity-uuid=\"e25b46bf-dffe-4a69-8e0e-b005bd7b71db\" src=\"/ikcs/sites/default/files/inline-images/ikcs-contact-map_0.jpg\" /></p>\r\n', '', 'full_html'),
('basic', 0, 8, 11, 'en', 0, '<p><img alt=\"ikcs map\" data-entity-type=\"file\" data-entity-uuid=\"54c9bcc6-f9d3-4076-885b-3f24285e5f6c\" src=\"/ikcs/sites/default/files/inline-images/ikcs-contact-map_1.jpg\" /></p>\r\n', '', 'basic_html'),
('basic', 0, 9, 12, 'en', 0, '<p><img class=\"img\" src=\"https://demo.dawpro.co.za/ikcs/sites/default/files/2018-12/ikcs-contact-map.jpg\" /></p>\r\n', '', 'full_html'),
('basic', 0, 9, 13, 'en', 0, '<p><img class=\"img\" src=\"https://demo.dawpro.co.za/ikcs/sites/default/files/2018-12/ikcs-contact-map.jpg\" /></p>\r\n', '', 'full_html'),
('basic', 0, 10, 14, 'en', 0, '<h3>Our National Footprint</h3>\r\n\r\n<div>A phone call away\r\n<div>&nbsp;</div>\r\n</div>\r\n', '', 'full_html'),
('basic', 0, 10, 15, 'en', 0, '<h3>Our National Footprint</h3>\r\n\r\n<div>A phone call away\r\n<div>&nbsp;</div>\r\n</div>\r\n', '', 'full_html'),
('basic', 0, 10, 16, 'en', 0, '<h3>Our National Footprint</h3>\r\n\r\n<div>A phone call away\r\n<div>&nbsp;</div>\r\n</div>\r\n', '', 'full_html'),
('basic', 0, 11, 17, 'en', 0, '<div class=\"map-title\">\r\n<h3>Our National Footprint</h3>\r\n<div>A phone call away</div>\r\n</div>', '', 'full_html'),
('basic', 0, 12, 18, 'en', 0, '<div class=\"text-center\"><img alt=\"Founder Paul Lucas\" data-entity-type=\"file\" data-entity-uuid=\"1934dbba-2885-4f3c-9618-3351796d25fa\" src=\"/sites/default/files/inline-images/founder-paul-lucas.jpg\" /></div>\r\n', '', 'full_html'),
('basic', 0, 13, 19, 'en', 0, '<div class=\"field--name-field-subtitle\">About the founder</div>\r\n\r\n<p>Paul Lucas has over 10 years’ experience in the industry, and is recognised for his ethical approach to service delivery, impeccable sense of reliability, unwavering commitment to quality, and vast knowledge of extraction and ventilation as a whole. Over the years, he has worked in various capacities within the restaurant cleaning industry, equipping himself with a wealth of experience that gives IKCS its competitive edge.</p>', '', 'full_html'),
('basic', 0, 14, 20, 'en', 0, '<div class=\"field--name-field-subtitle\">About the Founder </div>\r\n<p>Paul Lucas has over 10 years’ experience in the industry, and is recognised for his ethical approach to service delivery, impeccable sense of reliability, unwavering commitment to quality, and vast knowledge of extraction and ventilation as a whole. Over the years, he has worked in various capacities within the restaurant cleaning industry, equipping himself with a wealth of experience that gives IKCS its competitive edge.</p>', '', 'full_html'),
('basic', 0, 15, 21, 'en', 0, '<div class=\"field--name-field-subtitle\">About the Founder</div>\r\n\r\n<p>Paul Lucas has over 10 years’ experience in the industry, and is recognised for his ethical approach to service delivery, impeccable sense of reliability, unwavering commitment to quality, and vast knowledge of extraction and ventilation as a whole. Over the years, he has worked in various capacities within the restaurant cleaning industry, equipping himself with a wealth of experience that gives IKCS its competitive edge.</p>\r\n', '', 'full_html'),
('basic', 0, 17, 23, 'en', 0, '<div class=\"field--name-field-subtitle\">Our Community Commitment</div>\r\n\r\n<p>Our continuous expansion enables us to give back to our community by hiring and training new employees to support our growth. Educating new staff members is essential to the success of IKCS, and equipping our people with knowledge is integral to developing trustworthy and reliable working relationships. Our team is our family, and when you become an IKCS client, you become part of this family. </p>', '', 'full_html'),
('about_compliance', 0, 18, 24, 'en', 0, '<ul>\r\n	<li>IKCS is fully compliant with various governmental requirements, and our cleaning teams operate under the supervision of a trained O.H.A.S.A official at all times.</li>\r\n	<li>Our team is fully insured, and trained according to South African National Standards S.A.N.S 1850/2014.</li>\r\n	<li>All supervisors are fire marshals, first aiders, risk assessors, and SHE representatives. Qualifications and certification available on request. &nbsp;</li>\r\n</ul>\r\n', '', 'basic_html'),
('basic', 0, 20, 26, 'en', 0, '<div class=\"field--name-field-subtitle\">Leading the way</div>\r\n\r\n<p>The IKCS team is constantly growing in response to increased customer demand, ensuring that we have the manpower to provide all our clients with premium service and excellent turnaround times. We only employ highly qualified professionals who are as passionate about excellence and quality as we are, in order to give our clients the peace of mind that they are getting the best products and service that money can buy.</p>', '', 'full_html'),
('basic', 0, 20, 27, 'en', 0, '<div class=\"field--name-field-subtitle\">Leading the way</div>\r\n\r\n<p>The IKCS team is constantly growing in response to increased customer demand, ensuring that we have the manpower to provide all our clients with premium service and excellent turnaround times. We only employ highly qualified professionals who are as passionate about excellence and quality as we are, in order to give our clients the peace of mind that they are getting the best products and service that money can buy.</p>', '', 'full_html'),
('basic', 0, 20, 28, 'en', 0, '<div class=\"field--name-field-subtitle\">Leading the way</div>\r\n\r\n<p>The IKCS team is constantly growing in response to increased customer demand, ensuring that we have the manpower to provide all our clients with premium service and excellent turnaround times. We only employ highly qualified professionals who are as passionate about excellence and quality as we are, in order to give our clients the peace of mind that they are getting the best products and service that money can buy.</p>', '', 'full_html'),
('basic', 0, 21, 29, 'en', 0, '<div class=\"field--name-field-subtitle\">Leading the way</div>\r\n\r\n<p class=\"padded\">The IKCS team is constantly growing in response to increased customer demand, ensuring that we have the manpower to provide all our clients with premium service and excellent turnaround times. We only employ highly qualified professionals who are as passionate about excellence and quality as we are, in order to give our clients the peace of mind that they are getting the best products and service that money can buy.</p>\r\n', '', 'full_html'),
('basic', 0, 22, 36, 'en', 0, '<div class=\"field--name-field-subtitle\">&nbsp;</div>\r\n\r\n<div class=\"field--name-field-subtitle\">MEET THE TEAM</div>\r\n', '', 'full_html');
